import React,{useState,useEffect,useContext} from 'react'
import Nav from './Nav'
import axios from 'axios'
import {Taka,Counter} from "./Components"
import Context from './Context'
const Order = () => {
let url = 'http://127.0.0.1:8000/ordered'
let context = useContext(Context)
let userid = context.user.user_id
let [orderedData,setOrderedData] = useState()
useEffect(() => {
     if(userid){
     axios.post(url,{"userid":userid})
       .then((response)=>{
          console.log(response.data)
       })
       .catch((err)=>{
          console.log(err)
       })
    }
     else{
          console.log('unauthorized')
     }
}, [])
	let orderDetails = [
     {
          pk:0,
          active:true
     },
     {
          pk:0,
          active:false
     },
     {
          pk:0,
          active:false
     },
     {
          pk:0,
          active:false
     },
     {
          pk:0,
          active:false
     }

     ]
       let active = true
	return (
		<>
           <div className="order-page">
            <Nav colour={"ash"} visible={true} stick={false} ></Nav>
           	 <div className="orders">
           	 	{orderDetails.map((orders,i)=>{
                       if(orders.active){
           	 		return(
           	 		  <div className="order">
                              <div className={"item purpled"}>
                                   <div className="image">
                                    <img src="images/aot.jpg" alt=""/>
                                   </div>
                                   <div className="title">
                                        <h1>Attack on titan Vol. 1</h1>
                                   </div>
                                   <div className="trio">
                                        <Taka white={true} num={"zero"} taka={"220"} ></Taka>
                                        <Counter white={true} fixed={true} count={1}></Counter>

                                        <Taka white={true} num={"zero"} taka={"1220"} ></Taka>
                                   </div>
                              </div>
                              <div className={"deliver purpled"}>

                                   <div className="center">
                                   <div className="deliver-time">
                                        <h1 className="info-title">Order Delivey :</h1>
                                        <h1 className="time" > Tommorow </h1>
                                   </div>
                                   <div className="order-time">
                                        <h1 className="info-title">Order Placed  :</h1>
                                        <h1 className="time" > 3d ago </h1>
                                   </div>
                                   </div>

                              </div>

                           </div>   
           	 		)

                       }
                       else{
                         return(
                           <div className="order">
                              <div className={"item ash"}>
                                   <div className="image">
                                    <img src="images/aot.jpg" alt=""/>
                                   </div>
                                   <div className="title">
                                        <h1>Attack on titan Vol. 1</h1>
                                   </div>
                                   <div className="trio">
                                        <Taka white={true} num={"zero"} taka={"220"} ></Taka>
                                        <Counter fixed={true} count={1}></Counter>

                                        <Taka white={true} num={"zero"} taka={"1220"} ></Taka>
                                   </div>
                              </div>
                              <div className={"deliver ash"}>

                                   <div className="center">
                                   <div className="deliver-time">
                                        <h1 className="info-title">Order Delivey :</h1>
                                        <h1 className="time" > Tommorow </h1>
                                   </div>
                                   <div className="order-time">
                                        <h1 className="info-title">Order Placed  :</h1>
                                        <h1 className="time" > 3d ago </h1>
                                   </div>
                                   </div>

                              </div>

                           </div>      
                         )
                       }  
           	 	})}
           	 </div>
           </div>
		</>
	)
}

export default Order
